    if(inp1.checked){
        return inp2;
    }
    else if(inp2.checked){
        return inp3;
    }
    else if(inp3.checked){
        return inp4;
    }
    else if(inp4.checked){
        return inp5;
    }
    else if(inp5.checked){
        return inp1;
    }
    else{
        return inp1;
    }
};
setInterval(()=>{

    console.log(checkd().checked=true);
},2000)

back.addEventListener("click",()=>{
    backed().checked=true;
})
front.addEventListener("click",()=>{
